    render() {
        return (
            <div>
            <Button.Group widths='2' color="black" size="large" inverted>
            <Button>Login</Button>
            <Button>Favorites</Button>
                </Button.Group>
            <div className="image">
                <img src='https://images.unsplash.com/photo-1457369804613-52c61a468e7d?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&w=1000&q=80' alt="books" />
                    <h1><span>Welcome to Book Finder</span></h1>
            </div>
            </div>
        )
    }
}

export default NavBar
